$(function() {
    $('.datepicker').datepicker();

    var boletoBancario = new Backbone.DeepModel(),
        modelBinder = new Backbone.ModelBinder();

    function obterLinhasConverter(quantidadeDeLinhas) {
        return function(direction, value) {
            if(direction === 'ModelToView') {
                return (value && value.join('\n')) || '';
            } else {
                return value.split('\n').slice(0, quantidadeDeLinhas);
            }
        }
    }

    modelBinder.bind(boletoBancario, $('.boletoBancario'), {
        'banco': 'select#banco',
        'valor': {
            selector: 'input#valor',
            converter: function(direction, value) {
                if(direction === 'ModelToView') {
                    return value;
                } else {
                    return parseFloat(value.replace(',', '.'));
                }
            }
        },
        'numeroDoDocumento': 'input#numeroDoDocumento',
        'locaisDePagamento': {
            selector: 'textarea#localDePagamento',
            converter: obterLinhasConverter(2)
        },
        'instrucoes': {
            selector: 'textarea#instrucoes',
            converter: obterLinhasConverter(5)
        },

        'beneficiario.nome': 'input#nomeDoBeneficiario',
        'beneficiario.registroNacional': 'input#registroNacionalDoBeneficiario',
        'beneficiario.agencia': 'input#agenciaDoBeneficiario',
        'beneficiario.codigo': 'input#codigoDoBeneficiario',
        'beneficiario.carteira': 'input#carteira',
        'beneficiario.nossoNumero': 'input#nossoNumero',
        'beneficiario.digitoNossoNumero': 'input#digitoDoNossoNumero',

        'pagador.nome': 'input#nomeDoPagador',
        'pagador.registroNacional': 'input#registroNacionalDoPagador',
        'pagador.endereco.logradouro': 'input#logradouroDoPagador',
        'pagador.endereco.bairro': 'input#bairroDoPagador',
        'pagador.endereco.cidade': 'input#cidadeDoPagador',
        'pagador.endereco.uf': 'select#ufDoPagador',
        'pagador.endereco.cep': 'input#cepDoPagador',

        'datas.documento': 'input#dataDoDocumento',
        'datas.processamento': 'input#processamento',
        'datas.vencimento': 'input#vencimento',
    });

    $('button#gerarBoleto').bind('click', function() {
        if(confirm([
            'Esta ferramenta est disponvel para utilizao sob sua prpria conta e risco.',
            'Ao utilizar esta ferramenta voc assume toda a responsabilidade pelo boleto gerado.',
            'Voc deseja continuar?'
        ].join('\n\n'))) {
            window.location.href = "/emitir?" + $.param(boletoBancario.attributes);
        }
    });
});